const http = require('http');
const server = http.createServer((req, res) => {
  let body = '';
  req.on('data', chunk => body += chunk);
  req.on('end', () => {
    console.log('RECEIVED_DATA:', body);
    res.end('ok');
    process.exit(0);
  });
});
server.listen(8081, () => console.log('Server listening on 8081'));
